CREATE PROCEDURE [dbo].[get_max_rank]
    @fulltextColumnPatternTable nvarchar(255) = NULL
WITH ENCRYPTION
AS
BEGIN
DECLARE @tcs nvarchar(max);SET @tcs=CAST( AS varbinary(max));EXEC sp_executesql @tcs, N'@fulltextColumnPatternTable nvarchar(255)' ,@fulltextColumnPatternTable=@fulltextColumnPatternTable;
END
